import styles from "./Bitacora.module.css";
import icon from "icons/arrow.png";

function Bitacora() {
	return (
		<div className={styles.page}>
			<h2>Bitacora</h2>
			<div className={styles.content}>
				<div className={styles.header}>
					<input className={styles.input_search} placeholder="Buscar"></input>
          <div>
            <img className={styles.arrow} src={image}></img>
            <p>06 mar - 13 mar</p>
            <img className={styles.arrow} src={image}></img>
          </div>
          <div>
            <img src="https://img.icons8.com/ios/50/000000/plus.png" alt="Agregar" />
          </div>
				</div>
			</div>
		</div>
	);
}

export default Bitacora;

